Notes: 
This show was webcast via LivePhish. Landlady was last performed 12-03-1994 (768 show gap). Birdwatcher was last performed 6-28-2012 (134 show gap). Down With Disease was unfinished. Piper included a vocal tease of Rocking Down The Highway (Doobie Brothers) sung by Trey. The Harpua/After Midnight included narration about Jimmy being a guy from East Coast coming West and needing an oxygen tank and Trey sucking from an oxygen tank, he then said, &quot;I wonder if I should have gotten that oxygen tank up at the Phish show&quot;. Your Pet Cat included narration from Mike about eating Poster Nutbag. Once In A Lifetime was last performed 10-31-1996 (634 shows).


